    // })


    return (
        <div>
            {countries.map((country) => {
                return (
                    <div key={country._id}>
                        <li>
                            <Link to={country.name.common}> {country.alpha3Code} ></Link>
                        </li>
                    </div>
                )
            })}
        </div>
    )
}

export default CountriesList
